import React from "react";
import cakeImg from "./cake.png";

const cakes = [
  { name: "Chocolate cake", link: "", image: "./cake.png" },
  { name: "?", link: "", image: "./cake.png" },
  { name: "Mudcake", link: "mudcake", image: "./cake.png" },
  { name: "?", link: "", image: "./cake.png" }
];

const App = () => {
  if ("serviceWorker" in navigator) {
    window.addEventListener("load", function() {
      navigator.serviceWorker
        .register("/serviceWorker.js")
        .then(res => console.log("service worker registered"))
        .catch(err => console.log("service worker not registered", err));
    });
  }

  return (
    <>
      <nav>
        <h1>Fika inspiration</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
        </ul>
      </nav>
      <div className="container">
      <p className="text">Some vegan and gluten free cakes, cookies and other pastries. Enjoy</p>
        {cakes.map(({ name, image }) => (
          <div className="card">
            <img className="card--avatar" src={image} />
            <h1 className="card--title">{name}</h1>
            <a className="card--link">Try</a>
          </div>
        ))}
      </div>
      <div className="modal-content">
  <span className="close" onclick='clickClose()' >&times;</span>
  <p>Some text in the Modal..</p>
  </div>

    </>
  );
};

export default App;
